{

    "$id": "http://example.com/example.json",
    "type": "object",
    "default": {},
    "title": "Root Schema",
    "required": [
        "firstName",
        "lastName",
        "email",
        "dateOfBirth",
        "emailVerified",
        "signUpDate",
        "status",
        "level",
        "id"
    ],
    "properties": {
        "firstName": {
            "type": "string",
            "default": "",
            "title": "The firstName Schema",
            "examples": [
                "Dream"
            ]
        },
        "lastName": {
            "type": "string",
            "default": "",
            "title": "The lastName Schema",
            "examples": [
                "Real"
            ]
        },
        "email": {
            "type": "string",
            "default": "",
            "title": "The email Schema",
            "examples": [
                "dream.real@gmail.com"
            ]
        },
        "dateOfBirth": {
            "type": "string",
            "default": "",
            "title": "The dateOfBirth Schema",
            "examples": [
                "2001-10-99"
            ]
        },
        "emailVerified": {
            "type": "boolean",
            "default": false,
            "title": "The emailVerified Schema",
            "examples": [
                true
            ]
        },
        "signUpDate": {
            "type": "string",
            "default": "",
            "title": "The signUpDate Schema",
            "examples": [
                "2019-08-24"
            ]
        },
        "status": {
            "type": "string",
            "default": "",
            "title": "The status Schema",
            "examples": [
                "active"
            ]
        },
        "level": {
            "type": "string",
            "default": "",
            "title": "The level Schema",
            "examples": [
                "lord"
            ]
        },
        "id": {
            "type": "integer",
            "default": 0,
            "title": "The id Schema",
            "examples": [
                11
            ]
        }
    },
    "examples": [{
        "firstName": "Dream",
        "lastName": "Real",
        "email": "dream.real@gmail.com",
        "dateOfBirth": "2001-10-99",
